import React from "react";
import styles from "../burger-constructor/burger-constructor.module.css";
import {DragIcon} from "@ya.praktikum/react-developer-burger-ui-components";

function BurgerConstructor(props) {
    return (
        <div className={`${styles.burgerConstructor} pt-25`}>
            <ul className={styles.ingredientsList}>
                <li className={`${styles.ingredient} pt-4 pr-4 pb-4 pl-4`}>
                    <DragIcon type={"primary"}/>
                    {/*<img src={props.image} />*/}
                    <img className={`${styles.ingredientImage} pr-5 pl-6`} src="https://code.s3.yandex.net/react/code/bun-02.png" />
                    <p className={`${styles.ingredientName} text text_type_main-default`}>Краторная булка N-200i Краторная булка N-200i</p>
                    {/*<p>{props.name}</p>*/}
                </li>
            </ul>
        </div>
    );
}

export default BurgerConstructor;
